import { Routes,Route } from "react-router-dom";
import Home from "../home";
import Books from "../books";
const UserPortal = () => {
    return ( 
       <Routes>
            <Route element={<Home/>} path="/" />
            <Route element={<Books/>} path="/books" /> 
       </Routes>
     );
}
 
export default UserPortal;
